  [],\n\t\"revision_timestamp\": \"2016-07-27T22:56:10.827453\",\n\t\"name\": \"monitoring-western-snowy-plover-and-streaked-horned-lark-populations-leadbetter-point-will\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Monitoring is a crucial part of the conservation
  efforts for snowy plovers and larks on the Willapa National Wildlife Refuge (NWR)
  at Leadbetter Point. The ultimate measure of the effects of our recovery efforts
  for western snowy plover, is fledgling success (# of fledglings produced per breeding
  male). Because of the large size and complexity of the habitat at Leadbetter Point
  (particularly in the restoration area covered with oystershell), and the need to
  band and track broods to accurately estimate fledgling success, a robust monitoring
  effort is critical. In addition, the completed restoration work requires that we
  devote additional monitoring time in order to make decisions on efficacy. This project
  would be accomplished in an adaptive management context and provide new information
  that is needed to guide future decisions. We propose to monitor at least 4 days/week
  in the habitat restoration area and adjacent areas to implement planned actions,
  as well as, conduct nest searches, exclose nests from predators, monitor the status
  of nests, and find additional streaked horned lark nests and determine their fate.
  Tabular data will be entered and stored in refuge and statewide relational wildlife
  databases and spatially represented in GIS.\",\n\t\"license_title\": \"License Not
